from typing import List


class Solution:
    def numMatchingSubseq(self, S: str, words: List[str]) -> int:
        words.sort()
        ans = 0
        insideLoop = 0
        subMap = {}
        for word in words:
            cS = S
            cWord = word
            if subMap.get(word) is not None:
                ans += 1
                continue

            lastStart = None
            for i in range(1, len(word)):
                e = subMap.get(word[:i])
                if e is not None:
                    continue
                cS = cS[lastStart:]
                cWord = cWord[(i - 1):]
                print('Optimise', word, 'to', cWord)
                break

            insideLoop += 1
            ms_h = 0
            w_h = 0
            while True:
                # print(word, ms_h, w_h)
                if w_h == len(cWord):
                    ans += 1
                    break
                if ms_h == len(cS):
                    break
                if cS[ms_h] == cWord[w_h]:
                    w_h += 1
                    subMap[word[:w_h]] = w_h
                ms_h += 1
        return ans


